import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Register from './components/Register';
import Login from './components/Login';
import DiabeticPredictionForm from './components/DiabeticPredictionForm';
import HomePage from './components/HomePage';
import DiabeticResultPage from './components/DiabeticResultPage';

function App() {
  return (
    <Router>
      <Routes>
      <Route path="/" element={<Layout><HomePage /></Layout>} />
      <Route path="/predict" element={<Layout><DiabeticPredictionForm /></Layout>} />
      <Route path="/heart" element={<Layout><HeartForm /></Layout>} />
      <Route path="/login" element={<Layout><Login /></Layout>} />
      <Route path="/register" element={<Layout><Register /></Layout>} />
      </Routes>
    </Router>
  );
}

export default App;
